import { React } from "react";
import { useHistory } from "react-router-dom";
import "./styles.css";

const Drawer = () => {
  const history = useHistory();
  const handleGoatsClick = () => {
    history.push({
      pathname: "/goats",
      state: {
        filter: "goat",
      },
    });
  };
  const handleHomeClick = () => {
    history.push("/");
  };
  const handlePopularClick = () => {
    history.push("/");
  };
  const handleTrendingClick = () => {
    history.push("/");
  };
  const handleLatestClick = () => {
    history.push("/");
  };
  const handleUpcomingClick = () => {
    history.push("/");
  };
  const handleFavouritesClick = () => {
    history.push("/");
  };

  return (
    <div class="drawer-container">
      <div class="drawer-menu-item">
        <img
          src="https://dw-iconusers.flaticon.com/23366/23366610/1628830967584.svg?token=exp=1628831922~hmac=06441946d1616be8108139b8b475e335"
          alt=""
          onClick={handleHomeClick}
        />
      </div>
      <div class="drawer-menu-item">
        <img
          src="https://dw-iconusers.flaticon.com/23366/23366610/1628832144100.svg?token=exp=1628833157~hmac=711dbe8d264a76a035e4ebf7a2e285a8"
          alt=""
          onClick={handlePopularClick}
        />
      </div>
      <div class="drawer-menu-item">
        <img
          src="https://dw-iconusers.flaticon.com/23366/23366610/1628832183531.svg?token=exp=1628833157~hmac=db00865975cf463777dc54ecf4e7d6e9"
          alt=""
          onClick={handleTrendingClick}
        />
      </div>
      <div class="drawer-menu-item">
        <img
          src="https://dw-iconusers.flaticon.com/23366/23366610/1628832431526.svg?token=exp=1628833385~hmac=5083e2aac93dd67101ae9ef463c6d196"
          alt=""
          onClick={handleLatestClick}
        />
      </div>
      <div class="drawer-menu-item">
        <img
          src="https://dw-iconusers.flaticon.com/23366/23366610/1628832183531.svg?token=exp=1628833157~hmac=db00865975cf463777dc54ecf4e7d6e9"
          alt=""
          onClick={handleUpcomingClick}
        />
      </div>
      <div class="drawer-menu-item">
        <img
          src="https://dw-iconusers.flaticon.com/23366/23366610/1628832183531.svg?token=exp=1628833157~hmac=db00865975cf463777dc54ecf4e7d6e9"
          alt=""
          onClick={handleFavouritesClick}
        />
      </div>
    </div>
  );
};

export default Drawer;
